import { NavLink, Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="navBar">
      <Link to="/">
        <div>
          <h3>pictogram</h3>
        </div>
      </Link>
      <nav className="navButtons">
        {/* <div>Home</div>
        <div>SketchPad</div>
        <div>My Sketches</div> */}
        <NavLink path="/" className="button" exact>
          Home
        </NavLink>
        <NavLink path="/sketch-pad" className="button" exact>
          Sketch Pad
        </NavLink>
        <NavLink path="/my-sketchs" className="button" exact>
          My Sketches
        </NavLink>
      </nav>
    </div>
  );
};

export default NavBar;
